@Sergio10rialto De las últimas la única que me ha "gustado" medianamente es la que no le ha gustado a nadie y se la pegó que es la de Solo.
Rogue One me parece una historia sin sentido con personajes sin carisma alguno.
O sea, como Escuadrón Suicida pero sin Margot Robbie y con mejor CGI.

@FoxSportsBrasil 
Como é que vcs tds aí da Fox pode dizer que o flamengo não matou o 1 jogo da semifinal.
Quando na verdade o flamengo fez 4 gols para valer 1 E quando o Grêmio jogou que nem jogou só bateu nos jogadores do flamengo e se teve duas oportunidades de gol foi muito.

@confeniae1 @ecuamatt @CONAIE_Ecuador Y la sacaron gratis!

Claramente tenían un discurso suicida, exhortaron a sus filas a derramar la última gota de sangre... a ustedes no les importa los muertos, les importan resultados, aunque no entiendan lo que significa para el país. 

No hay más racista q el indígena.

@paolacossetin @AguinaldoDr @hilde_angel @moema4 De qual ~pesquisa~ ele tirou a informação que a maioria dos petroleiros votou no Bozo?

Mesmo q fosse assim, acho q um suicida merece mais respeito por dois motivos pelo menos no caso: 1- não deve ter votado no Coiso e 2- tanto faz!

Qdo as reações começam a se igualar é o caos.

@MohaBangarda
Mira tengo un estilo distinto y lo pinto con cada hilo de mi vida

En esta ida he sido vencido, pero vivo con un instinto suicida

